import { Component } from '@angular/core';

@Component({
  selector: 'app-hike-details',
  templateUrl: './hike-details.component.html',
  styleUrls: ['./hike-details.component.css']
})
export class HikeDetailsComponent {

}
<section class="hike-details">
    <div class="image-container">
        <img src="https://huttohuthikingdolomites.com/wp-content/uploads/Commanding-Monte-Civetta.jpg" alt="mountain-peak">
    </div>

    <div class="content-container">
        <h2>Peak Canin</h2>
        <h3>Julian Alps - Slovenia</h3>
        <p class="duration">Duration: 3 hours</p>
        <div class="divider"></div>
        <p class="post-author">Posted by: tanya@gmail.com</p>

    </div>
</section>
